    data: |
      SELECT DISTINCT - col1 * - ( 27 ) * - cor0.col2 - cor0.col1 / 39 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q2011.out
    data: |
      -201476
      -2621
      -76628
